def kClosest(self, points, k: int, ):
        ans = []
        while k > 0:              
            Min = 2**32
            Loc = 0
            for i in range(len(points)):
                Com = points[i][0]**2 + points[i][1]**2
                if Min > Com:
                    Min = Com
                    Loc = i        
            ans.append(points.pop(Loc))
            k -= 1
        return ans       


def kClosest2(points, k: int):
        points.sort(key=squared_distance)
        return points[:k]
    
def squared_distance(point):
    return point[0]**2 + point[1]**2

import heapq
def kClosest3(points, k: int):
    ### Since heap is sorted in increasing order, negate the distance to simulate max heap and fill the heap with the first k elements of points
        heap = [(-squared_distance(points[i]), i) for i in range(k)]
        heapq.heapify(heap)
        for i in range(k, len(points)):
            dist = -squared_distance(points[i])
            if dist > heap[0][0]:
                # If this point is closer than the kth farthest,discard the farthest point and add this one
                heapq.heappushpop(heap, (dist, i))
        
        # Return all points stored in the max heap
        return [points[i] for (_, i) in heap]

